import React from "react";
import { Nav, Navbar, Container } from "react-bootstrap";

const Home = () => {
	return (
		<div className="Home">
			<Navbar bg = "dark" variant="dark">
				
					<Navbar.Brand href="#home">Home</Navbar.Brand>
					<Nav className="NavigateButton">
						<Nav.Link href="#schematic">Schematic</Nav.Link>
						<Nav.Link href="#map">Map</Nav.Link>
						<Nav.Link href="#logic">Logic</Nav.Link>
					</Nav>
				
			</Navbar>
		</div>
	);
};

export default Home;
